def inc(s):
    l = [1] * len(s)
    for i in range(len(s)):
        for j in range(i+1, len(s)):
            if (s[i] < s[j]):
                l[j] = max(l[j], l[i] + 1)
    a = []
    b = max(l)
    for i in range(len(s) - 1, -1, -1):
        if (b == l[i]):
            a.append(s[i])
            b = b - 1
    return a[::-1]

